import axios from "axios";

const handleSubmit = async (e) => {
  e.preventDefault();
  try {
    const res = await axios.post("http://localhost:5000/api/register", formData);
    alert(res.data.msg);
  } catch (err) {
    alert(err.response.data.msg);
  }
};
